import React from 'react';
import styles from './styles.module.css'
import Logo from '../../Logos/logo_palpite'

const Header = () => {
  return (
    <div className={styles.header}>
      <div className="container">
        <h1>Header</h1>
      <Logo/>
      </div>
    </div>
  )
};

export default Header;
